import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 15.2-1636.11 Determination of population.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/15.2-1636.11.md","filePath":"vacode/15.2-1636.11.md"}'),o={name:"vacode/15.2-1636.11.md"},n=r('<h1 id="§-15-2-1636-11-determination-of-population" tabindex="-1">§ 15.2-1636.11 Determination of population. <a class="header-anchor" href="#§-15-2-1636-11-determination-of-population" aria-label="Permalink to &quot;§ 15.2-1636.11 Determination of population.&quot;">​</a></h1><p>For the purpose of fixing salaries specified in §§ <a href="http://law.lis.virginia.gov/vacode/15.2-1608.1/" target="_blank" rel="noreferrer">15.2-1608.1</a>, <a href="http://law.lis.virginia.gov/vacode/15.2-1608.2/" target="_blank" rel="noreferrer">15.2-1608.2</a>, <a href="http://law.lis.virginia.gov/vacode/15.2-1609.2/" target="_blank" rel="noreferrer">15.2-1609.2</a>, <a href="http://law.lis.virginia.gov/vacode/15.2-1627.1/" target="_blank" rel="noreferrer">15.2-1627.1</a>, <a href="http://law.lis.virginia.gov/vacode/15.2-1636.1/" target="_blank" rel="noreferrer">15.2-1636.1</a>, and <a href="http://law.lis.virginia.gov/vacode/15.2-1636.2/" target="_blank" rel="noreferrer">15.2-1636.2</a>, the population of each county and city shall be according to the last preceding United States census. If the area of any city has, since the last preceding United States census, been increased by annexation, the population of such city, for such purposes, shall be the population thereof as shown by the last preceding United States census, plus the increase resulting from such annexation. Whenever it appears to the satisfaction of the Compensation Board that the population of any county or city has, since the last preceding United States census, increased so as to entitle such county or city to be placed in a higher salary bracket, such county or city shall be considered within such higher salary brackets.</p><p>Code 1950, § 14-74; 1964, c. 386, § 14.1-61; 1983, c. 600; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0872" target="_blank" rel="noreferrer">872</a>.</p>',3),i=[n];function s(c,l,h,p,d,f){return a(),t("div",null,i)}const g=e(o,[["render",s]]);export{u as __pageData,g as default};
